import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import data from './data/medicines.json';
function App() {
  const newdata = data.map(data => {
    return (
      <div className="row medicine">
        <img className="col-lg-3 medicine_image" src={data.image} />
        <div><p className="medicine_name">{data.name}</p>
          <p className="medicine_description">{data.description}</p></div>
      </div>
    );
  });
  return (<div className="container medicines_list">{newdata}</div>);
}

export default App;
